{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/gregoryoliveira/google-data-analytics-capstone-cyclistic?scriptVersionId=105701667\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"6849e552","metadata":{"_kg_hide-input":true,"_kg_hide-output":true,"papermill":{"duration":0.008934,"end_time":"2022-09-15T01:48:26.173504","exception":false,"start_time":"2022-09-15T01:48:26.16457","status":"completed"},"tags":[]},"source":["# 0. Summary\n","\n","- Purpose: identify pattern on casual riders to convert them into members riders;\n","\n","- Main question: what can we do to maximize the number of rider members?;\n","\n","- Techniques: exploratory data analysis, data vizualization, time series analysis, and linear regression;\n","\n","- Language: R;\n","\n","- Libraries: tidyverse, tidymodels, modelr, and patchwork;"]},{"cell_type":"markdown","id":"9ab6cc18","metadata":{"papermill":{"duration":0.007127,"end_time":"2022-09-15T01:48:26.188022","exception":false,"start_time":"2022-09-15T01:48:26.180895","status":"completed"},"tags":[]},"source":["# 1. Introduction\n","\n","This notebook is a study case of [Google Data Analystics Professioanl Course at Cousera](https://www.coursera.org/professional-certificates/google-data-analytics). Its purpose is to present the analytical skills I earn with the course. On this way, they deliver me a roadmap to guide me. I will present here each step of this guide. I will use this notebook to record the steps I take to achieve my goal and with the results I will create a presentation.\n","\n","## 1.1 Scenario\n","\n","You are a junior data analyst working in the marketing analyst team at Cyclistic, a bike-share company in Chicago. The director of marketing believes the company’s future success depends on maximizing the number of annual memberships. Therefore, your team wants to understand how casual riders and annual members use Cyclistic bikes differently. From these insights, your team will design a new marketing strategy to convert casual riders into annual members. But first, Cyclistic executives must approve your recommendations, so they must be backed up with compelling data insights and professional data visualizations.\n","\n","## 1.2 Data Analyze Phases\n","\n","It is important to say that on the course, we are introduced on the 6 data analyze phases:\n","\n","- Ask\n","\n","- Prepare\n","\n","- Process\n","\n","- Analyze\n","\n","- Share\n","\n","- Act\n","\n","Let's start with the **Ask** phase."]},{"cell_type":"markdown","id":"fde9f6d3","metadata":{"papermill":{"duration":0.007288,"end_time":"2022-09-15T01:48:26.202883","exception":false,"start_time":"2022-09-15T01:48:26.195595","status":"completed"},"tags":[]},"source":["# 2. Ask\n","\n","Our design marketing strategies aimed at converting casual riders into annual members. To achieve this, we will answer the questions: how do annual members and casual riders use Cyclistic bikes differently? We will basically use count, distance, duration, and location of rides. Besides ride information, we will use some weather information. This may show us how each group is affected by temperature, rain and snow.\n","\n","Observation: if the rider_id is available we could identify customers subscriptions and analyze them to understand the pattern before and after the subscription. This will make it possible to create campaigns for this group."]},{"cell_type":"markdown","id":"19e6cacf","metadata":{"papermill":{"duration":0.007019,"end_time":"2022-09-15T01:48:26.217113","exception":false,"start_time":"2022-09-15T01:48:26.210094","status":"completed"},"tags":[]},"source":["## 3. Prepare\n","\n","The only source that we will use is the [Divvy Data](https://ride.divvybikes.com/system-data). The dataset license is avaiable [here](https://ride.divvybikes.com/data-license-agreement). We do not found any problem with integrity. We just found some NA cells, but we will address them on next seccion.\n","\n","The dataset that we will work have the following columns:\n","\n","- character: ride_id, rideable_type, start_station_name, start_station_id, end_station_name, end_station_id, and member_casual;\n","\n","- date/time: started_at, and ended_at; and, \n","\n","- double: start_lat, start_lng, end_lat, and end_lng.\n","\n","Let's import our data!"]},{"cell_type":"code","execution_count":1,"id":"6e07e279","metadata":{"_execution_state":"idle","_kg_hide-input":true,"_kg_hide-output":true,"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","execution":{"iopub.execute_input":"2022-09-15T01:48:26.239203Z","iopub.status.busy":"2022-09-15T01:48:26.236101Z","iopub.status.idle":"2022-09-15T01:50:04.283119Z","shell.execute_reply":"2022-09-15T01:50:04.280372Z"},"papermill":{"duration":98.061572,"end_time":"2022-09-15T01:50:04.28758","exception":false,"start_time":"2022-09-15T01:48:26.226008","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.6     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.8\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::