mory\n","rm(rides_raw, temp, myfiles)"]},{"cell_type":"code","execution_count":4,"id":"51c2e8a3","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:51:28.384098Z","iopub.status.busy":"2022-09-15T01:51:28.382111Z","iopub.status.idle":"2022-09-15T01:51:41.734265Z","shell.execute_reply":"2022-09-15T01:51:41.731553Z"},"papermill":{"duration":13.368538,"end_time":"2022-09-15T01:51:41.737854","exception":false,"start_time":"2022-09-15T01:51:28.369316","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["── Data Summary ────────────────────────\n","                           Values     \n","Name                       rides_clean\n","Number of rows             5718816    \n","Number of columns          18         \n","_______________________               \n","Column type frequency:                \n","  factor                   4          \n","  numeric                  10         \n","  POSIXct                  4          \n","________________________              \n","Group variables            None       \n","\n","── Variable type: factor ───────────────────────────────────────────────────────\n","  skim_variable      n_missing complete_rate ordered n_unique\n","1 rideable_type              0         1     FALSE          3\n","2 start_station_name    745376         0.870 FALSE        861\n","3 end_station_name      791531         0.862 FALSE        860\n","4 member_casual              0         1     FALSE          2\n","  top_counts                                    \n","1 cla: 3246440, ele: 2168852, doc: 303524       \n","2 Str: 83904, Mic: 44224, Wel: 44007, Mil: 42199\n","3 Str: 84694, Mic: 44635, Wel: 44124, Mil: 42895\n","4 mem: 3175924, cas: 2542892                    \n","\n","── Variable type: numeric ──────────────────────────────────────────────────────\n","   skim_variable   n_missing complete_rate     mean hist     min       max\n"," 1 start_lat               0             1   41.9   