 time! :-)"]},{"cell_type":"code","execution_count":8,"id":"e676e04f","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:11.562485Z","iopub.status.busy":"2022-09-15T01:52:11.56062Z","iopub.status.idle":"2022-09-15T01:52:26.271736Z","shell.execute_reply":"2022-09-15T01:52:26.269622Z"},"papermill":{"duration":14.730576,"end_time":"2022-09-15T01:52:26.274383","exception":false,"start_time":"2022-09-15T01:52:11.543807","status":"completed"},"tags":[]},"outputs":[],"source":["# Dropping docked_bike\n","rides_clean <- rides_clean %>%\n","    filter(rideable_type != \"docked_bike\")\n","\n","# Creating some time variables\n","rides_clean <- rides_clean %>%\n","    mutate(\n","        # Preparing season analysis\n","        across(\n","            where(is.POSIXct),\n","            list(\n","                month = ~ month(.x, label = TRUE, abbr = TRUE),\n","                day = day,\n","                wday = ~ wday(.x, label = TRUE, abbr = TRUE))),\n","        # Creating a factor to periods of the day\n","        period = case_when(\n","            between(started_at_floor_month, 3, 5) ~ \"Spring\",\n","            between(started_at_floor_month, 6, 8) ~ \"Summer\",\n","            between(started_at_floor_month, 9, 11) ~ \"Fall\", \n","            TRUE ~ \"Winter\"),\n","        period = factor(\n","            period,\n","            levels = c(\"Spring\",\"Summer\",\"Fall\", \"Winter\"))\n","        ) %>%\n","    # Removing unnecessary columns\n","    select(-started_at_floor) %>%\n","    # Renaming columns\n","    rename(\n","        month = started_at_floor_month,\n","        wday = started_at_floor_wday,\n","        day = started_at_floor_day,\n","    ) %>%\n","    # Shifting factor month because we are analyzing 12 months starting at April\n","    mutate(month = fct_shift(month, 3))"]},{"cell_type":"code","execution_count":9,"id":"ceef1f32","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:26.307593Z","iopub.status.busy":"2022-09-15T01:52:26.305871Z","iopub.status.idle":"2022-09-15T01:52:26.812798Z","shell.execute_reply":"2022-09-15T01:52:26.81076Z"},"papermill":{"duration":0.526467,"end_time":"2022-09-15T01:52:26.815285","exception":false,"start_time":"2022-09-15T01:52:26.288818","status":"completed"},"tags":[]},"outputs":[],"source":["# Summary only considering the member and casual riders\n","rides_summary1 <- rides_clean %>%\n","    mutate(\n","        speed = (distance / 1e3) / duration_hour,\n","        ) %>%\n","    group_by(member_casual, period, month) %>%\n","    summarize(\n","        rides = n(),\n","        distance_mean = mean(distance),\n","        distance_max = max(distance),\n","        duration_hour_mean = mean(duration_hour),\n","        duration_hour_max = max(duration_hour),\n","        speed_mean = mean(speed),\n","        speed_max = max(speed)\n","    ) %>%\n","    #ungroup() %>%\n","    group_by(month) %>%\n","    mutate(\n","        across(\n","            rides,\n","            ~ .x / sum(.x),\n","            .names = \"{.col}_perc\"\n","        )\n","    ) %>%\n","    ungroup() %>%\n","    mutate(month = factor(month, ordered = FALSE))"]},{"cell_type":"code","execution_count":10,"id":"5b013f18","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:26.848114Z","iopub.status.busy":"2022-09-15T01:52:26.846364Z","iopub.status.idle":"2022-09-15T01:52:27.820387Z","shell.execute_reply":"2022-09-15T01:52:27.818329Z"},"papermill":{"duration":0.995037,"end_time":"2022-09-15T01:52:27.824656","exception":false,"start_time":"2022-09-15T01:52:26.829619","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAQOCAIAAABTsuyMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2DTRh8G8JNX7Ow9CDOQQELYBAh7E1bZe4+2UKC8UGihZZbRlllKWzoYpVBa\nKCNl7wIte5QRRiAQRhgJZJDpJLb1fpCtOLHs2LLsmPb5fRK6k3Sn052jPyeJommaAAAAAAAA\nAAAAgGMQlXUBAAAAAAAAAAAAoAgCdgAAAAAAAAAAAA4EATsAAAAAAAAAAAAHgoAdAAAAAAA