","        aes(label = percent(rides_perc, accuracy = 0.1)),\n","        position = position_stack(vjust = 0.5),\n","        size = 5,\n","        check_overlap = TRUE\n","    ) + \n","    facet_wrap(~ member_casual, nrow = 2) +\n","    scale_x_discrete(expand = c(0,0)) +\n","    scale_y_continuous(expand = c(0,0)) +\n","    scale_fill_brewer(palette = \"Spectral\") +\n","    theme_light(\n","      base_size = 20,\n","      base_line_size = 0\n","    ) +\n","    labs(\n","        x = NULL,\n","        y = NULL,\n","        title = \"Percent of rides by rideable type\",\n","        subtitle = str_c(\n","            \"As we said, we can see a season effect with electric rides usage \",\n","            \"increasing on colder months. Members prefer classic bikes, despite their higher speed.\",\n","            sep = \"\\n\"\n","        ),\n","        fill = \"Rideable Type\"\n","    ) + \n","    theme(\n","     # legend.position = \"bottom\", \n","     axis.title.y = element_blank(),\n","     axis.text.y = element_blank(),\n","     axis.ticks.y = element_blank(),\n","     axis.ticks.x = element_line(size = 0.2, color = \"black\"),\n","     axis.line.x = element_line(size = 0.2, color = \"black\")\n","   )"]},{"cell_type":"markdown","id":"238eaf61","metadata":{"papermill":{"duration":0.025544,"end_time":"2022-09-15T01:52:30.635914","exception":false,"start_time":"2022-09-15T01:52:30.61037","status":"completed"},"tags":[]},"source":["Well, summarizing our findings until now:\n","\n","- all metrics analyzed shows some seasonal effect;\n","\n","- the months between April and August are the best to create some campaigns to attract casual riders to our membership subscription;\n","\n","- casual riders tend to use our bikes on higher distance and duration; and,\n","\n","- our members are faster than casual riders, but the difference between them is not strong.\n","\n","It is time now to better understand this seasonal effect. We will use linear modeling techniques to accomplish this. But before this, I would like to thank Hadley Wickham and their colleagues. I only learned how to deal with this data because I read the [R for DataScience](https://r4ds.had.co.nz/model-building.html) and 2nd edition of [ggplot2: Elegant Graphics for Data Analysis](https://ggplot2-book.org/). On 3rd edition, the ggplot book does not have a capter to deal with modeling. The plots that I am doing now it is because this two great and FREE books!"]},{"cell_type":"code","execution_count":16,"id":"a1d82d02","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:30.69015Z","iopub.status.busy":"2022-09-15T01:52:30.688202Z","iopub.status.idle":"2022-09-15T01:52:32.84216Z","shell.execute_reply":"2022-09-15T01:52:32.839925Z"},"papermill":{"duration":2.186843,"end_time":"2022-09-15T01:52:32.84764","exception":false,"start_time":"2022-09-15T01:52:30.660797","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAQOCAIAAABTsuyMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2ATZR8H8N9ldiTde9FJB3tvRGQKiLg34MCFiqCCAwQFQVRk6SsiKu6tgIDI\nkCVLUGZZpRNaoHtn3/vHpWma1SSXNil8P//0evfck+d5cs9zd7/cYFiWJQAAAAAAAAAAAPAM\nAncXAAAAAAAAAAAAABohYAcAAAAAAAAAAOBBELADAAAAAAAAAADwIAjYAQAAAAAAAAAAeBAE\n7AAAAAAAAAAAADwIAnYAAAAAAAAAAAAeBAE7AAAAAAAAAAAAD4KAHQAAAAAAAAAAgAdBwA4A\nAAAAAAAAAMCDIGAHAAAAAAAAAADgQRCwAwAAAAAAAAAA8CAI2AEAAAAAAAAAAHgQBOwAAAAA\nAAAAAAA8CAJ2AAAAAAAAAAAAHgQBu7ZKU3fSRyhgGkQP+cbdJQIH/DUhkfvi+i475cTqQWIh\nt3quUuvysrkEq600bJzuLst16syqAVz7p9y7291laVWe3ztayEB/L67im8oVLs/8um1V23iO\n5NeMQ8934toh48n9xvPRPtcMl48A1rYZAAAAMIaAXVuV99vz9TrW8O+V/dOvqHVuLA8AAAAA\nAAAAALiEyN0FACetfvUf43+1qivP/335myFR7ioPALS+f/fuqdbqiKjrwMH+QlzMCAAAAAAA\ncI1AwK5NUlbseDevipsOEAkqNDoi2v7Cejr8hFvLBfbyiUlKS5MSUXyQ1N1lgTbssdHD/q1R\nEdGOCsWN/tiWAFoVRnLb0D4AAAAAfCBg1yadX/OylmWJSOSVuP7VgMGz/yWikmMzsxWPJXoJ\n3V06aF6fFVtPu7sMAADAB0Zy29A+AAAAAHzgGXZt0uJ39M9vjh21vNeTr3HTOk3Vc39edF+h\nAAAAAAAAAADABRCwa3vqrn755ZVabvqBxQO8gidMCvfl/t038zv3lQsAAAAAAAAAAFwAAbu2\n5+