AAAAAA\nOBACOwAAAAAAAMCBENgBAAAAAAAADoTADgAAAAAAAHAgBHYAAAAAAACAAyGwAwAAAAAAABwI\ngR0AAAAAAADgQAjsAAAAAAAAAAdCYAcAAAAAAAA4EAI7AAAAAAAAwIEQ2AEAAAAAAAAOhMAO\nAAAAAAAAcCAEdgAAAAAAAIADIbADAAAAAAAAHAiBHQAAAAAAAOBACOwAAAAAAAAAB/J/meUq\nZDF4liMAAAAASUVORK5CYII="},"metadata":{"image/png":{"height":519.12,"width":840}},"output_type":"display_data"}],"source":["# Summary only considering the member and casual riders\n","rides_summary3 <- rides_clean %>%\n","    group_by(member_casual, period, month, day, wday) %>%\n","    summarize(\n","        rides = n(),\n","        distance_total = sum(distance)\n","    ) %>%\n","    ungroup() %>%\n","    mutate(\n","        across(\n","            where(is.factor),\n","            ~ factor(.x, ordered = FALSE),\n","           )\n","        )\n","\n","# Fist model: rides ~ month + wday\n","rides_model <- function(df) {\n","    lm(rides ~ month * wday, data = df)\n","}\n","\n","# Using linear model to find average rate and season influence\n","rides_mdl1 <- rides_summary3 %>%\n","    select(member_casual:rides) %>%\n","    group_by(member_casual) %>%\n","    nest() %>%\n","    mutate(\n","        model = map(data, rides_model),\n","        resids = map2(data, model, add_residuals),\n","        quality = map(model, glance),\n","        coef = map(model, tidy),\n","        pred = map2(data, model, add_predictions),\n","          )\n","\n","rides_mdl1 %>%\n","    select(member_casual, pred) %>%\n","    unnest() %>%\n","    mutate(\n","        # To use when modeling required\n","        #rides_pred = exp(pred),\n","        month_wday = str_c(month, wday, sep = \" \")\n","    ) %>%\n","    distinct(member_casual, period, month, wday, .keep_all = TRUE) %>%\n","    ggplot(aes(x = wday, y = pred, group = member_casual, color = member_casual)) +\n","    geom_line() +\n","    geom_ref_line(h = 0)  +\n","    scale_x_discrete(\n","        guide = guide_axis(check.overlap = TRUE),\n","    ) + \n","    scale_y_continuous(\n","        expand = expansion(mult = c(0, .05)),\n","        label = label_comma()\n","    ) +\n","    facet_wrap(~month, scales = \"free\") +\n","    theme_light(\n","      base_size = 18,\n","      # base_line_size = 0\n","    ) +\n","    theme(\n","        legend.position = \"bottom\"\n","    ) +\n","    labs(\n","        x = \"Weekday\",\n","        y = \"Average Rides (Linear Predicting)\",\n","        title = \"Average rides by month and weekday using a linear model\",\n","        subtitle = \"There are many interesting thing to say...\",\n","        color = \"Membership\"\n","    )"]},{"cell_type":"markdown","id":"4a148eb8","metadata":{"papermill":{"duration":0.030649,"end_time":"2022-09-15T01:52:32.909648","exception":false,"start_time":"2022-09-15T01:52:32.878999","status":"completed"},"tags":[]},"source":["Some insights that we can take from the last plot:\n","\n","- members tend to use our bikes on labor days, in contrast to the casual riders that tend to use on weekends;\n","\n","- casual rides are higher than members rides only on weekends from May to September. However, on labor days members rides are higher all months;\n","\n","- volume of members rides are more stable than casual rides. Looking, for example, to May, rides decrease from almost 12,500 (Saturday) to 5,000 (Tuesday); and,\n","\n","- well, considering this, our campaigns should be run on weekends to convert casual membership to annual subscriptions.\n","\n","We collected data about the weather in Chicago to understand how temperature, rain and snow impact the number of rides, but we will do this later.\n","\n","We will now focus on understanding if some station is preferred by casual riders. We will summarize data considering this goal. However, we will need to create a way to sort the stations. On this hand, we will create a KPI where the weight of total rides by that station is 75%. The first step is create the measure..."]},{"cell_type":"code","execution_count":17,"id":"c036dcf6","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:32.978096Z","iopub.status.busy":"2022-09-15T01:52:32.976224Z","iopub.status.idle":"2022-09-15T01:52:33.830962Z","shell.execute_reply":"2022-09-15T01:52:33.828793Z"},"papermill":{"duration":0.891844,"end_time":"2022-09-15T01:52:33.834794","exception":false,"start_time":"2022-09-15T01:52:32.94295","status":"completed"},"tags":[]},"outputs":[],"source":["# Summary only considering the member and casual riders\n","rides_summary4 <- rides_clean %>%\n","    group_by(member_casual, start_station_name, period, month) %>%\n","    summarize(\n","        rides = n()\n","    ) %>%\n","    #ungroup() %>%\n","    group_by(start_station_name, month) %>%\n","    mutate(\n","        across(\n","            rides,\n","            list(\n","                perc = ~ .x / sum(.x),\n","                total = ~ sum(.x)\n","                ),\n","            .names = \"{.col}_{.fn}\"\n","        )\n","    ) %>%\n","    ungroup() %>%\n","    mutate(\n","        month = factor(month, ordered = FALSE),\n","        rides_total_norm = rides_total / max(rides_total),\n","        # Creating a measure to maximize rides_perc and rides_total \n","        rides_kpi = sqrt(0.25*(rides_perc^2) + 0.75*(rides_total_norm^2))\n","    ) %>%\n","    filter(member_casual == \"casual\", rides_perc != 1, rides_total > 100) %>%\n","    group_by(month) %>%\n","    top_n(n = 5, wt = rides_kpi) %>%\n","    arrange(month) %>%\n","    mutate(position = row_number(rides_total)) %>%\n","    transmute(\n","        start_station_name,\n","        period,\n","        month,\n","        casual = rides,\n","        members = rides_total - rides,\n","        position\n","    ) %>%\n","    pivot_longer(\n","        casual:members,\n","        names_to = \"member_casual\",\n","        values_to = \"rides\"\n","    ) %>%\n","    mutate(member_casual = factor(member_casual, levels = c(\"members\", \"casual\")))"]},{"cell_type":"markdown","id":"e2561e59","metadata":{"papermill":{"duration":0.029049,"end_time":"2022-09-15T01:52:33.893194","exception":false,"start_time":"2022-09-15T01:52:33.864145","status":"completed"},"tags":[]},"source":["Then, we make a function to help us create the plots!"]},{"cell_type":"code","execution_count":18,"id":"48d3fb2a","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:33.956124Z","iopub.status.busy":"2022-09-15T01:52:33.954084Z","iopub.status.idle":"2022-09-15T01:52:33.972691Z","shell.execute_reply":"2022-09-15T01:52:33.970437Z"},"papermill":{"duration":0.052989,"end_time":"2022-09-15T01:52:33.975657","exception":false,"start_time":"2022-09-15T01:52:33.922668","status":"completed"},"tags":[]},"outputs":[],"source":["plot_station_season <- function(plot_season = \"Spring\") {\n","\n","    rides_summary4 %>%\n","        filter(period == plot_season) %>%\n","        ggplot(aes(x = fct_reorder(start_station_name, position), y = rides, fill = member_casual)) +\n","        geom_col() +\n","        facet_wrap(~fct_shift(month, -3), scales = \"free\", nrow = 3) +\n","        scale_x_discrete(expand = c(0,0)) +\n","        scale_y_continuous(\n","            expand = c(0,0),\n","            label = label_comma()\n","        ) +\n","        scale_fill_brewer(palette = \"Spectral\") +\n","        coord_flip() +\n","        theme_light(\n","          base_size = 18,\n","          # base_line_size = 0\n","        ) +\n","        labs(\n","            x = \"Start station\",\n","            y = \"Rides\",\n","            title = \"Start stations with higher rides and casual riders\",\n","            subtitle = str_c(\"Season: \", plot_season),\n","            color = \"Membership\"\n","        )\n","    \n","}"]},{"cell_type":"markdown","id":"5dbb5238","metadata":{"papermill":{"duration":0.030588,"end_time":"2022-09-15T01:52:34.035563","exception":false,"start_time":"2022-09-15T01:52:34.004975","status":"completed"},"tags":[]},"source":["And, voala, here is the stations with higher presence of casual riders!"]},{"cell_type":"code","execution_count":19,"id":"544c75fa","metadata":{"_kg_hide-input":true,"execution":{"iopub.execute_input":"2022-09-15T01:52:34.099566Z","iopub.status.busy":"2022-09-15T01:52:34.097658Z","iopub.status.idle":"2022-09-15T01:52:36.776144Z","shell.execute_reply":"2022-09-15T01:52:36.773766Z"},"papermill":{"duration":2.714251,"end_time":"2022-09-15T01:52:36.779536","exception":false,"start_time":"2022-09-15T01:52:34.065285","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABpAAAAQOCAIAAABTsuyMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZWAURxsH8GfP4+4hCSGBENxdirsVKRSKFPpCgRaXtkCRFiguRYqVthRokeLF\n3d1DgIR4AnG9nO37YY8QzrjkcslB/79Py+7s7Myzu3fck9kdhmVZAgAAAAAAAAAAAMvAK+sG\nAAAAAAAAAAAAwBtI2AEAAAAAAAAAAFgQJOwAAAAAAAAAAAAsCBJ2AAAAAAAAAAAAFgQJOwAA\nAAAAAAAAAAuChB0AAAAAAAAAAIAFQcIOAAAAAAAAAADAgiBhBwAAAAAAAAAAYEGQsAMAAAAA\nAAAAALAgSNgBAAAAAAAAAABYECTsAAAAAAAAAAAALAgSdgAAAAAAAAAAABYECTsAAAAAAAAA\nAAALgoQdAAAAAAAAAACABUHCDgCgtD29tG/WpFEdmtXy9/W0txYJJTbObt41GrQYOHr6H4eu\nydmybt9/3umegQzDMAzTcMXDsm7L+6F4EQtb34TbK7j/uZJtjyk1m+Psm6+nlsDEiDkL+dzu\nL/KVJd62/wjEsMRdG1+NC2noqMslWzPuFwAAMJ6grBsAAPAf8urW7uGfj91/J+Ht1fK0/Ny0\n5IR7185tW7Pgy4DGP67eOKZz5bJpIgAAAAAAAJQ1JOwAAEpJ+N9Ta3yySKp6M4JOYOXg7uok\nUOalpaZkSRXcyqwXl77qWvXs7EN/z+igXcmtC+ezlCoiqtm0uQOfKZ2Wl+HRzXfEso3kfwfi\nDAAAAABQDEjYAQCUhsyIjTVfZ+v4QpdPJ04fMbB3w1B/AZfBYBUxT24f3PXHkgVrn+fIWVa1\na2bHUZUj1/YO0KhnRMc2t7JlRHQqXfqRg7iUe1H6RzffEQ3UbO1bISRETEQBzqUd4feUgYiV\n7RVbDDj7RYWIARgP9wsAABgPCTsAgNIwu+PkPBVLREKbarvuXOgWZP/WZkZQLqTeqO/qfT52\nxKf1mu56mkFEm4Z0+7bbbV8Rv0wa/F/WYNXxx2XdhvfLhxSxD6kvpQMRAzAe7hcAADAeJp0A\nADC7/LRjy55mcMv99xzWzNYVInKo+tvFbXZ8HhHJc+4P3RlRSk0EAAAAAAAAi4GEHQCA2WW+\nWMuyLBExjHBlax/Dha3cOi+o4swt31t61+yNAwAAAAAAAAuDhB0AgNllPErlFhi+rTHv3a/X\nzotbkGVGmbFZRlE9uxRX1m34YCmlqXGxcdkyVVk3BP5rTL+v8clgEtz7/zHv4/3yPrYZAOBD\ng4QdAIDZSdwl3IJKkbYyIvOd5evOv5adnZ2dnR334GtuzZ3ZdRiGYRiGe38/EbVylHBrJkVm\naOwuz3y+afHMTzo3r+Dv62grEUpsXNx9ajdpO2LqgpP3k3Ue8d7CelxtHz